def parse_size(size):

    units = {"KB": 1024, "MB": 1024**2, "GB": 1024**3}
    if <mask_if>:
        return int(size)
    unit = size[-2:].upper()
    number = size[:-2]
    if unit in units and number.isdigit():
        return int(number) * units[unit]
    raise ValueError("Size must be in the format <number>[KB|MB|GB].")

